import React from 'react'
import LightBorderInput from "../shared/ui/LightBorderInput/LightBorderInput";

const App = () => {
    return (
        <div>
            <h1>poizonhub radiad test</h1>
            <LightBorderInput type="text" placeholder="test"></LightBorderInput>
            <LightBorderInput type="text" placeholder="qwe"></LightBorderInput>
            <LightBorderInput type="text" placeholder="asd"></LightBorderInput>
            <LightBorderInput type="text" placeholder="zxc"></LightBorderInput>
        </div>
    )
}

export default App
